import React from 'react';
import {
  Box,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper
} from '@mui/material';
import { toWords } from 'number-to-words';

const FormComponentNMT = ({ 
  rollNumber = 'NMT2023001',
  name = 'Student Name',
  sod = "Parent's Name",
  examDate = 'June 2025',
  subjectsData = [
    {
      paperNo: 'I',
      subject: 'Anatomy, Physiology & Basic Chemistry, Physics and Maths',
      theoryMax: 100,
      theorySecured: 85,
      practicalMax: null,
      practicalSecured: null,
      totalMax: 100,
      totalSecured: 85,
      result: 'Pass'
    },
    // Add other papers similarly
  ],
  specialty = 'Nuclear Medicine Technology'
}) => {
  const borderStyle = '1px solid #ddd';
  const headerBg = '#f5f5f5';

  // Calculate grand total
  const grandTotal = subjectsData.reduce((total, subject) => total + (subject.totalSecured || 0), 0);
  const totalInWords = toWords(grandTotal).replace(/,/g, ' ').toUpperCase();

  return (
    <Box sx={{ 
      p: 3, 
      maxWidth: 1200, 
      mx: 'auto',
      fontFamily: 'Arial',
      border: borderStyle,
      boxShadow: 3
    }}>
      {/* University Header */}


      {/* Document Title */}
      <Typography variant="h6" align="center" sx={{ 
        fontWeight: 'bold', 
        mb: 3,
        textDecoration: 'underline'
      }}>
        MEMORANDUM OF MARKS
      </Typography>

      {/* Student Information */}
      <Box sx={{ mb: 3 }}>
        <Typography><strong>Roll No:</strong> {rollNumber}</Typography>
        <Typography variant="h6" sx={{ fontWeight: 'bold', my: 1 }}>
          Postgraduate Diploma in {specialty}
        </Typography>
        <Typography>
          First Year Final Examination held in the month of {examDate}
        </Typography>
        <Typography><strong>Name:</strong> {name}</Typography>
        <Typography><strong>S/O./D/O:</strong> {sod}</Typography>
      </Box>

      {/* Marks Table */}
      <TableContainer component={Paper} sx={{ mb: 2 }}>
        <Table size="medium" sx={{ border: borderStyle }}>
          <TableHead>
            <TableRow sx={{ backgroundColor: headerBg }}>
              <TableCell sx={{ fontWeight: 'bold', border: borderStyle }}>Paper</TableCell>
              <TableCell sx={{ fontWeight: 'bold', border: borderStyle }}>Subject</TableCell>
              <TableCell align="center" colSpan={2} sx={{ fontWeight: 'bold',  }}>Theory</TableCell>
              <TableCell align="center" colSpan={2} sx={{ fontWeight: 'bold', border: borderStyle }}>Practical/Viva</TableCell>
              <TableCell align="center" colSpan={2} sx={{ fontWeight: 'bold', border: borderStyle }}>Total</TableCell>
            </TableRow>
            <TableRow sx={{ backgroundColor: headerBg }}>
              <TableCell sx={{ border: borderStyle }}></TableCell>
              <TableCell sx={{ border: borderStyle }}></TableCell>
              <TableCell >Maximum Marks</TableCell>
              <TableCell >Marks Secured</TableCell>
              <TableCell >Maximum Marks</TableCell>
              <TableCell >Marks Secured</TableCell>
              <TableCell >Maximum Marks</TableCell>
              <TableCell >Marks Secured</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subjectsData.map((subject, index) => (
              <TableRow key={index}>
                <TableCell sx={{ border: borderStyle }}>{subject.paperNo}</TableCell>
                <TableCell sx={{ border: borderStyle }}>{subject.subject}</TableCell>
                <TableCell >{subject.theoryMax}</TableCell>
                <TableCell >{subject.theorySecured || '-'}</TableCell>
                <TableCell >{subject.practicalMax || 'NA'}</TableCell>
                <TableCell>
                  {subject.practicalMax ? (subject.practicalSecured || '-') : 'NA'}
                </TableCell>
                <TableCell >{subject.totalMax}</TableCell>
                <TableCell>{subject.totalSecured || '-'}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {/* Footer Information */}
      <Box sx={{ mt: 2 }}>
        <Typography>
          <strong>Aggregate marks in words:</strong> {totalInWords}
        </Typography>
        <Typography sx={{ mt: 1 }}>
          <strong>Result:</strong> PASS
        </Typography>
        <Typography align="right" sx={{ mt: 3 }}>
          <strong>Dated:</strong> {new Date().toLocaleDateString('en-IN')}<br />
          EXECUTIVE REGISTRAR
        </Typography>
        <Typography variant="caption" sx={{ 
          mt: 2, 
          display: 'block',
          fontStyle: 'italic'
        }}>
          AP: Already Pass; AB: Absent; NA: Not applicable
        </Typography>
      </Box>
    </Box>
  );
};

export default FormComponentNMT;
